import React, { Component } from 'react';
import './App.css';
import { BrowserRouter as Router } from 'react-router-dom';
import Collection from './collection'
import BaseRouter from './routes';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Collection>
          <BaseRouter />
        </Collection>
      </div>
    );
  }
}

export default App;
